            { position.position1 &&
                <h2>One</h2>
            }
            </div>
            <div className="Position2">
            { position.position2 &&
                <h2>Two</h2>
            }
            </div>
            <div className="Position3">
            {position.position3 &&
                <h2>Three</h2>
            }
            </div>
            <div className="Position4">
            {position.position4 &&
                <h2>Four</h2>
            }
            </div>
        </div>

    );
}

export default VideoPosition
